export const formText = {
    "en": {
        "firstName": "First Name",
        "lastName" : "Last Name",
        "message": "Message...",
        "title": "Feel free to contact with any questions, problems or feedback"
    },

    "pt": {
        "firstName": "Nome Próprio",
        "lastName" : "Apelido",
        "message": "Mensagem...",
        "title": "Contacte-nos com quaisquer perguntas, problemas ou feedback"
    }
}
